	/**
	 * Test the get adjancy matrix.
	 */
	@Test
	public void testGetAdjancyMatrix() {
		try{
			BioMatrix m = rw.getAdjancyMatrix();
			assertEquals("adjancy matrix not square",m.numRows(),m.numCols());
			assertEquals("missing vertex in adjancy matrix",g.vertexSet().size(), m.numCols());
		}catch(Exception e){
			e.printStackTrace();
			fail("error while computing adjancy matrix");
		}
	}
	
	/**
	 * Test the clean node of interest list.
	 */
	@Test
	public void testCleanNodeOfInterestList(){
		int cleaned = rw.cleanNodeOfInterestList(g, TestRandomWalk.nodesOfInterest);
		assertEquals("error while cleaning list of nodes of interest", NB_BAD_NOI, cleaned);
		assertFalse("missing node present in list of nodes of interest",TestRandomWalk.nodesOfInterest.contains("bad_input_node"));
	}
	
	/**
	 * Test the get target nodes of interest.
	 */
	@Test
	public void testGetTargetNodesOfInterest(){
		Set<String> targetNodesOfInterest = rw.getTargetNodesOfInterest(g, TestRandomWalk.nodesOfInterest);
		assertEquals("error while identifying target nodes",NB_TARGET_NOI, targetNodesOfInterest.size());
	}
	
	/**
	 * Test the set constant part of q.
	 */
	@Test
	public void testSetConstantPartOfQ(){
		try{
			BioMatrix m = rw.getSubQ();
			assertEquals("Q sub-matrix not square",m.numRows(),m.numCols());
			assertEquals("wrong number of rows and columns in Q sub-matrix",g.vertexSet().size()-rw.nodesOfInterest.size(), m.numCols());
		}catch(Exception e){
			e.printStackTrace();
			fail("error while computing Q sub-matrix");
		}
	}
	
	/**
	 * Test the get xabsorbing matrix.
	 */
	@Test
	public void testGetXabsorbingMatrix(){
		try{
			BioMatrix m = rw.getXabsorbingMatrix(rw.nodesOfInterest.iterator().next(), rw.adjancyMatrix);
			assertEquals("Absorbing matrix not square",m.numRows(),m.numCols());
			assertEquals("wrong number of rows and columns in absorbing matrix",rw.subQ.numCols()+1, m.numCols());
		}catch(Exception e){
			e.printStackTrace();
			fail("error while computing absorbing matrix");
		}
	}
	
	/**
	 * Test the get fundamental matrix.
	 */
	@Test
	public void testGetFundamentalMatrix(){
		try{
			BioMatrix m = rw.getFundamentalMatrix(rw.getXabsorbingMatrix(rw.nodesOfInterest.iterator().next(),rw.adjancyMatrix));
			assertEquals("Fundamental matrix not square",m.numRows(),m.numCols());
			assertEquals("wrong number of rows and columns in fundamental matrix",rw.subQ.numCols()+1, m.numCols());

		}catch(Exception e){
			e.printStackTrace();
			fail("error while computing fundamental matrix");
		}
	}
	
